import React, {Component} from 'react';
import './App.css';

class App extends Component {

  componentDidMount = async () => {
    const response = await axios.get("https://restcountries.eu/rest/v2/all")
    console.log(response);
    this.setState({
      countries: response.data
    })
  }
  render() {
    return (
      <div className="App">
        <h1>Hello!</h1>
      </div>
    );
  }
}

export default App;
